import { Routes, Route } from "react-router-dom";
import Log from "./Login/Login";
import Jan22 from "./Charts/jan22";
import Feb22 from "./Charts/feb22";
import March22 from "./Charts/march22";
import Apr22 from "./Charts/april22";
i
import MonthData from "./Dashboard/MonthData";
function App() {
  return (
    <>
      <Routes>
        <Route path="/" element={<Log />} />
        <Route path="/jan22" element={<Jan22 />} />
        <Route path="/feb22" element={<Feb22 />} />
        <Route path="/MonthData" element={<MonthData />} />
        <Route path="/mar22" element={<March22 />} />
        <Route path="/april22" element={<Apr22 />} /> 
      </Routes>
    </>
  );          
}

export default App;
